import './App.css';
import BG from './Images/BG.jpg'
import AsherSignature from './Images/AsherSignature.png'


function App() {
  return (
    <div className="App">
      <div className='container'>
      <img src={AsherSignature} className="App-logo" alt="logo" />
      </div>
      <div>
      <h1 className='imageText Green'>The website is currently under construction, please come back soon!</h1>

      </div>

    </div>
  );
}

export default App;
